import React from "react";

const App = () => {
    let date = new Date();
    let hh = date.getHours();
    let mm = date.getMinutes();
    let ss = date.getSeconds();
    const run=()=>{
        console.log(hh,mm,ss)
    }
   
    return (
        <>
           
            <button className="btn" onClick={run} >click me!</button>
        </>
    )
}
export default App;
